import React from 'react';

function App() {
  return (
    <div id="App">
      <nav>
        <h1>CryptoImage</h1>
        <p>Fun way to encrypt messages to friends!</p>
      </nav>
      <div>
        <input></input>
      </div>
    </div>
  );
}

export default App;
